import React from "react";


function Result(props) {
    const {name} = props

    return (
      <div> 

        {name&&
          <table class="table">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">Name</th>
              </tr>
            </thead>
            {name.map((e, index) => {
              <tr>
                <th scope="row">{index}</th>
                <td>{e}</td>
              </tr>
            })}
            {/* <tbody>

              <tr>
                <th scope="row">2</th>
                <td>Jacob</td>
              </tr>
              <tr>
                <th scope="row">3</th>
                <td>Larry</td>
              </tr>
            </tbody> */}
          </table>           
        }

      </div>

    );
  }

export default Result
